import { Card } from "react-bootstrap";

interface ACard {
    title: {
        english: string
    }
    coverImage: {
        large: string;
    }
    year: number;
}

export const AnimeCard = (anime: any) => {
    return (
        <Card className="card-grid">
            <Card.Img variant="top" src={anime.coverImage.large}/>
            <Card.Title>{anime.title.english}</Card.Title>
        </Card>
    );
}
